import React from 'react';
import TaskToggle from "../task-toogle/task-toggle";
import TaskButton from "../task-button/task-button";
import TaskLabel from "../task-label/task-label";
import TaskListItem from "../task-list-item/task-list-item";


const Task = ({label, className}) => {
    return <div className={className}  >
                <TaskToggle className="toggle" type="checkbox"/>
                <TaskLabel    onClick={ () =>console.log('done')} label={label}/>
                <TaskButton className='icon icon-edit'/>
                <TaskButton className='icon icon-destroy'/>
        </div>
}

export default Task;
